import styled from "styled-components";



export const Main =styled.main`
    position: relative;
    z-index: 1;
`;

export const Wrapper = styled.div``;

export const Context = styled.div`
    background:  url(${({ image }) => image}) no-repeat, #3e3f66;
    color: #fff;
    background-size: 50%;
    `;
